import os
import sys
import time
import threading
import base64
import webbrowser

from io import BytesIO
from pathlib import Path

from src.config import ConfigManager

project_root = Path(__file__)
config_manager = ConfigManager()
sys.path.insert(0, str(project_root))


def hide_console():
    """隐藏控制台窗口"""
    try:
        import ctypes

        # 获取当前控制台窗口句柄
        kernel32 = ctypes.windll.kernel32
        user32 = ctypes.windll.user32

        console_window = kernel32.GetConsoleWindow()
        if console_window:
            # 隐藏控制台窗口 (SW_HIDE = 0)
            user32.ShowWindow(console_window, 0)
    except:
        pass  # 如果隐藏失败，继续运行


def create_system_tray():
    """创建系统托盘"""
    try:
        import pystray
        from PIL import Image

        # 获取配置以决定是否显示调试信息
        config = config_manager.app_config
        show_console = config.show_console

        def create_icon():
            try:
                base64_str = """

                """
                # Base64 转二进制
                byte_data = base64.b64decode(base64_str)
                # 将二进制转为 PIL 格式图片
                image = Image.open(BytesIO(byte_data))
                return image
            except Exception as e:
                if show_console:
                    print(f"加载图标失败: {e}")
                return Image.new("RGBA", (32, 32), color=(103, 80, 164, 255))

        def on_quit(icon, item):
            icon.stop()
            os._exit(0)

        def on_open_browser(icon, item):
            try:
                webbrowser.open("http://localhost:5000")
            except:
                pass

        def on_show_console(icon, item):
            try:
                import ctypes

                kernel32 = ctypes.windll.kernel32
                user32 = ctypes.windll.user32
                console_window = kernel32.GetConsoleWindow()
                if console_window:
                    user32.ShowWindow(console_window, 1)  # SW_NORMAL = 1
            except:
                pass

        # 创建托盘菜单
        menu = pystray.Menu(
            pystray.MenuItem("打开浏览器", on_open_browser),
            pystray.MenuItem("显示控制台", on_show_console),
            pystray.MenuItem("退出程序", on_quit),
        )

        # 创建托盘图标
        icon = pystray.Icon("Onekey", create_icon(), menu=menu)

        # 在单独的线程中运行托盘
        def run_tray():
            icon.run()

        tray_thread = threading.Thread(target=run_tray)
        tray_thread.daemon = True
        tray_thread.start()

        return True
    except ImportError:
        return False


def main():
    try:
        config = config_manager.app_config
        show_console = config.show_console

        if show_console:
            print("正在启动Onekey...")
            print("=" * 50)

        # 如果不显示控制台，则隐藏窗口并创建系统托盘
        if not show_console:
            hide_console()
            tray_created = create_system_tray()
            # 注意：这里不再打印信息，因为控制台已经隐藏
        else:
            # 显示控制台模式下也可以创建系统托盘
            tray_created = create_system_tray()
            if tray_created:
                print("系统托盘已创建")

        def open_browser():
            time.sleep(2)
            try:
                webbrowser.open("http://localhost:5000")
                if show_console:
                    print("浏览器已自动打开")
            except:
                if show_console:
                    print("无法自动打开浏览器，请手动访问: http://localhost:5000")

        browser_thread = threading.Thread(target=open_browser)
        browser_thread.daemon = True
        browser_thread.start()

        # 启动Web应用
        from web.app import app
        from uvicorn import Config
        from uvicorn.server import Server

        server = Server(Config(app, host="0.0.0.0", port=5000, log_level="error"))
        server.run()
    except KeyboardInterrupt:
        if show_console:
            print("\n程序已退出")
    except Exception as e:
        if show_console:
            print(f"启动错误: {e}")
            input("按回车键退出...")
        else:
            # 如果隐藏控制台模式下出错，创建一个错误日志
            error_log = Path("error.log")
            with open(error_log, "w", encoding="utf-8") as f:
                f.write(f"启动失败: {e}\n")


main()
